            <p>
                <span className="text-gray-600 font-size: 24px line-height: 28.13px  font-family:roboto font-bold">Nama</span>
                </p>
                <strong className="text-black font-size: 18px line-height: 21.09px  font-family:roboto font-bold">Andrew Alfred</strong>

            {/* </div> */}
            </div>
            </div>
        </figure>
        </>
    );
}
export default Profile
